-- RESEQUENCE en ORACLE
-- create or replace PROCEDURE RESEQUENCE (pkColumnName VARCHAR2, table_name VARCHAR2, seq_name VARCHAR2) AS maxPK NUMBER; vQueryPK VARCHAR2(100); vQuerySEQ VARCHAR2(100); BEGIN vQueryPK := 'SELECT nvl(max(' || pkColumnName|| '), 0) + 1 FROM ' || table_name ; EXECUTE IMMEDIATE vQueryPK INTO maxPK; DBMS_OUTPUT.put_line('Ultima PK en Uso: ' || maxPK); BEGIN EXECUTE IMMEDIATE 'DROP sequence ' || seq_name; EXCEPTION WHEN OTHERS THEN DBMS_OUTPUT.put_line ('No se ha encontrado la secuencia: ' || seq_name || '. Creando...'); END; vQuerySEQ := 'CREATE SEQUENCE ' || seq_name || ' START WITH ' || maxPK ; EXECUTE IMMEDIATE vQuerySEQ; END RESEQUENCE; --;
--
--create or replace EDITIONABLE TRIGGER "SETTINGS_PK_TRG" before INSERT ON SETTINGS FOR EACH row BEGIN IF inserting THEN IF :NEW.SETTINGS_ID IS NULL THEN SELECT SETTINGS_SEQ.nextval INTO :NEW."SETTINGS_ID" FROM dual; END IF; END IF; END; --;
--
--create or replace EDITIONABLE TRIGGER "SEC_USER_PK_TRG" before INSERT ON SEC_USER FOR EACH row BEGIN IF inserting THEN IF :NEW.USER_ID IS NULL THEN SELECT SEC_USER_SEQ.nextval INTO :NEW."USER_ID" FROM dual; END IF; END IF; END; --;
--create or replace EDITIONABLE TRIGGER "SEC_ROLE_PK_TRG" before INSERT ON SEC_ROLE FOR EACH row BEGIN IF inserting THEN IF :NEW.ROLE_ID IS NULL THEN SELECT SEC_ROLE_SEQ.nextval INTO :NEW."ROLE_ID" FROM dual; END IF; END IF; END; --;
--create or replace EDITIONABLE TRIGGER "SEC_PERMISSION_PK_TRG" before INSERT ON SEC_PERMISSION FOR EACH row BEGIN IF inserting THEN IF :NEW.PERMISSION_ID IS NULL THEN SELECT SEC_PERMISSION_SEQ.nextval INTO :NEW."PERMISSION_ID" FROM dual; END IF; END IF; END; --;

